import ReportTabs from "./components/ReportTabs";
import AllList from "./components/AllList";
import WatchList from "./components/WatchList";
import BannedList from "./components/BannedList";
import UpdatedLogs from "./components/FetchUpdatedLogs";
import React, { useState } from "react";

function App() {
  const [tab, setTab] = useState([]); //initial mount on page load

  return (
    <div>
      <h1>Most Wanted</h1>
      <div className="main">
        <ReportTabs setTab={setTab} />

        <div className="searchBar">search</div>

        <div className="label">
          <li>Report Number </li>
          <li>Involved Parties </li>
          <li>Type</li>
          <li>Location </li>
          <li>Attachments </li>
        </div>

        <div class="wrapper">
          <div class="box a">Report Number</div>
          <div class="box b">Involved Parties</div>
          <div class="box c">Type</div>
        </div>

        <div className="content"></div>
        {tab === "AllList" ? <AllList /> : null}
        {tab === "WatchList" ? <WatchList /> : null}
        {tab === "BannedList" ? <BannedList /> : null}
        {tab === "UpdatedLogs" ? <UpdatedLogs /> : null}
      </div>
    </div>
  );
}

export default App;
